T_MODULES_DIR}\" ]; then\ncp -R \"${SIMULATOR_SWIFT_MODULES_DIR}\" \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/Modules/${PROJECT_NAME}.swiftmodule\"\nfi\n\nRESOURCES_BUNDLE_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}_${PROJECT_NAME}.bundle\"\nif [ -e $RESOURCES_BUNDLE_PATH ] \nthen\ncp -r $RESOURCES_BUNDLE_PATH \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\"\nfi\n\n\n# Step 4. Create universal binary file using lipo and place the combined executable in the copied framework directory\n#Bước 4 : Tạo một \"universal binary file\" sử dụng lipo\nlipo -create -output \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/${PROJECT_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}.framework/${PROJECT_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${PROJECT_NAME}.framework/${PROJECT_NAME}\"\n\n#Dirrect to project name.framework/Headers/project name-Swift.h file name\nswift_header=\"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/Headers/${PROJECT_NAME}-Swift.h\"\n\n#Modify the content in project name.framework/Headers/project name-Swift.h\nnewline1=\"#if defined(__x86_64__) && __x86_64__ || (__arm64__) && __arm64__ || (__i386__) && __i386__\"\n\n#Find #if 0 and replace it with nothing\nsed -i '' 's/#if 0//g' $swift_header\n\n#Find #elif defined(__arm64__) && __arm64__ and replace it with nothing\nsed -i '' 's/#elif defined(__arm64__) && __arm64__//g' $swift_header\n\n#Add the string newline1 in the first line of 1\n#sed -i '' \"1 a\\\\ $newline1\" $swift_header\nex -sc \"1i|$newline1\" -cx \"$swift_header\"\n\n# Step 5. Convenience step to copy the framework to the project's directory\n#Bước 5. Copy framework vào thư mục của project\nrm -R \"${PROJECT_DIR}/../GalaxyPayPodSDK/${PROJECT_NAME}.framework\" \ncp -R \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\" \"${PROJECT_DIR}/../GalaxyPayPodSDK/\"\n#cp -R \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\" \"${PROJECT_DIR}\"\n\nrm -R \"${PROJECT_DIR}/build\"\n\n";
